import React from 'react'
import Card from 'react-bootstrap/Card'
import logo from '../images/nike.png';

const ItemCarrito = (props) => {
  return (
    <div>
        <Card>
            <Card.Img variant='top' src={{image}}/>
        </Card>

    </div>
  )
}

export default ItemCarrito
